import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import Header from "./components/Header";
import Home from "./pages/Home";
import Footer from "./components/Footer";
import Detials from "./pages/Detials";
import Cart from "./pages/Cart";
import React from "react";
import productInfo from "./data/store-items.json";
import img1 from "./img/item-1.png";
import img2 from "./img/item-2.png";
import img3 from "./img/item-3.png";
import img4 from "./img/item-4.png";
import img5 from "./img/item-5.png";
import img6 from "./img/item-6.png";
const imgsArr = [img1, img2, img3, img4, img5, img6];

console.log(productInfo);
class App extends React.Component {
  state = {
    products: [
      { name: "test1", img: img1 },
      { name: "test2", img: img2 },
      { name: "test3", img: img3 },
    ],
  };

  showDeateils() {
    console.log("test");
  }
  render() {
    return (
      <BrowserRouter>
        <Header />
        <Routes>
          <Route path="/" element={<Home products={this.state.products} />} />
          <Route path="/products" element={<Detials />} />
          <Route path="/cart" element={<Cart images={imgsArr} />} />
        </Routes>
        <Footer />
      </BrowserRouter>
    );
  }
}

export default App;
